CREATE TABLE mysql_all_types(
  id integer PRIMARY KEY,
  c_boolean boolean,
  c_tinyint smallint,
  c_smallint smallint,
  c_mediumint integer,
  c_integer integer,
  c_bigint bigint,
  c_decimal decimal,
  c_float real,
  c_double double,
  c_char_255 varchar,
  c_varchar_10000 varchar,
  c_text varchar,
  c_blob bytea,
  c_binary_255 bytea,
  c_varbinary_10000 bytea,
  c_date date,
  c_time time,
  c_datetime timestamp,
  c_timestamp timestamptz,
  c_json JSONB,
  c_smallint_array smallint[],
  c_integer_array integer[],
  c_bigint_array bigint[],
  c_real_array real[],
  c_double_precision_array double precision[],
  c_varchar_array varchar[],
);

